import { useState } from 'react';
import { motion } from 'framer-motion';

export default function App() {
    const [darkMode, setDarkMode] = useState(false);

    const navItems = ['Accueil', 'Projets', 'Processus', 'Expertise', 'Contact'];

    return (
        <div className={`min-h-screen ${darkMode ? 'bg-[#0a0a0a] text-gray-100' : 'bg-[#faf9f5] text-[#1a1a1a]'}`}>
            {/* Header élégant avec effet glassmorphism */}
            <header className={`fixed w-full z-50 ${darkMode ? 'bg-[#0a0a0a]/80' : 'bg-[#faf9f5]/80'} backdrop-blur-md border-b ${darkMode ? 'border-[#1f1f1f]' : 'border-[#eaeaea]'}`}>
                <div className="container mx-auto px-6 py-4 flex items-center justify-between">
                    {/* Logo SVG qui s'adapte au mode */}
                    <div className="w-12 h-12">
                        <svg
                            viewBox="0 0 1280 720"
                            className="w-full h-full"
                            fill={darkMode ? "white" : "black"}
                        >
                            <path d="M2020 3865 l0 -1335 1318 0 1319 0 6 998 c4 548 7 1149 7 1335 l0 337 -1325 0 -1325 0 0 -1335z m1329 520 c26 -270 44 -336 108 -397 58 -55 124 -75 318 -93 99 -10 186 -21 194 -25 7 -4 -29 -10 -80 -14 -198 -16 -328 -35 -367 -55 -46 -23 -108 -90 -128 -136 -7 -18 -20 -104 -29 -191 -24 -240 -26 -254 -35 -224 -5 14 -15 102 -24 195 -15 150 -20 177 -47 233 -31 63 -81 111 -139 134 -30 12 -196 35 -318 44 -51 3 -95 11 -98 15 -3 5 5 9 18 9 13 0 100 9 193 19 194 21 247 40 308 112 51 59 64 106 82 302 24 245 28 251 44 72z"/>
                        </svg>
                    </div>

                    {/* Navigation centrée - style minimaliste */}
                    <nav className="hidden md:flex items-center gap-8">
                        {navItems.map((item) => (
                            <motion.a
                                key={item}
                                href="#"
                                whileHover={{ y: -2 }}
                                className={`text-sm uppercase tracking-wider ${darkMode ? 'text-gray-300 hover:text-white' : 'text-gray-600 hover:text-black'}`}
                            >
                                {item}
                            </motion.a>
                        ))}
                    </nav>

                    {/* Bouton dark mode discret */}
                    <button
                        onClick={() => setDarkMode(!darkMode)}
                        className="p-2 rounded-full hover:bg-opacity-10 hover:bg-gray-500 transition-all"
                        aria-label="Toggle dark mode"
                    >
                        {darkMode ? (
                            <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 3v1m0 16v1m9-9h-1M4 12H3m15.364 6.364l-.707-.707M6.343 6.343l-.707-.707m12.728 0l-.707.707M6.343 17.657l-.707.707M16 12a4 4 0 11-8 0 4 4 0 018 0z" />
                            </svg>
                        ) : (
                            <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M20.354 15.354A9 9 0 018.646 3.646 9.003 9.003 0 0012 21a9.003 9.003 0 008.354-5.646z" />
                            </svg>
                        )}
                    </button>
                </div>
            </header>

            {/* Hero section - style Mazette */}
            <main className="pt-32 pb-20 px-6">
                <section className="container mx-auto">
                    <motion.div
                        initial={{ opacity: 0, y: 20 }}
                        animate={{ opacity: 1, y: 0 }}
                        transition={{ duration: 0.8, delay: 0.2 }}
                        className="max-w-5xl mx-auto"
                    >
                        <h1 className="text-5xl md:text-7xl font-medium mb-8 leading-tight">
                            Beyond —<br />
                            <span className={`${darkMode ? 'text-gray-300' : 'text-gray-600'}`}>Design d'exception</span><br />
                            pour marques ambitieuses
                        </h1>

                        <div className="flex flex-col md:flex-row gap-8 mt-16">
                            <motion.div
                                whileHover={{ y: -5 }}
                                className="flex-1 border-t pt-6"
                            >
                                <h3 className="text-sm uppercase tracking-wider mb-4">Expertise</h3>
                                <p className="text-lg">Nous concevons des identités visuelles puissantes et des expériences digitales mémorables.</p>
                            </motion.div>

                            <motion.div
                                whileHover={{ y: -5 }}
                                className="flex-1 border-t pt-6"
                            >
                                <h3 className="text-sm uppercase tracking-wider mb-4">Approche</h3>
                                <p className="text-lg">Une méthodologie sur-mesure pour des résultats qui transcendent les attentes.</p>
                            </motion.div>
                        </div>
                    </motion.div>
                </section>
            </main>

            {/* Footer minimal */}
            <footer className={`py-8 border-t ${darkMode ? 'border-[#1f1f1f]' : 'border-[#eaeaea]'}`}>
                <div className="container mx-auto px-6 text-center text-sm">
                    <p>Beyond © {new Date().getFullYear()} — Tous droits réservés</p>
                </div>
            </footer>
        </div>
    );
}
